import axios from 'axios';



class Lista extends Component{

    constructor(props){

        super(props);


       this.state = {
        _embedded : { todoModels : [{
        "marcado" : true,
        "vazio" : true,
        "texto" : "Teste Realizado com sucesso!",
        "_links" : {
          "self" : {
            "href" : "http://localhost:8080/api/todoModels/1"
          },
          "todoModel" : {
            "href" : "http://localhost:8080/api/todoModels/1"
          }
        }
      }] }}



      axios.get('localhost:8080/api/todoModels')
        .then(res => {
         //const tmodels = res;

         console.log("OSFsf");

          //alert("Alerta");


         // this.setState(tmodels);
        })



